    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                bool isSave = false;
                mster = journalrepository.EditJournalVoucher(Convert.ToInt64(id));
                isSave = journalrepository.DeleteJournlVoucher(mster.JournalMasterId, mster.VoucherNo, mster.VoucherTypeId, mster.FinancialYearId, mster.CompanyId);
                if (isSave == true)
